import "./style/Footer.css"

const  Footer = () =>{
    return(
    <React.Fragment>
        <div className="Footer">
            <p>🐉 Powered by React JS UTCH BIS 🐉</p>
        </div>
    </React.Fragment>
    );
}

export default Footer;
